pragma solidity >=0.4.22 <0.7.0;
pragma experimental ABIEncoderV2;

contract Scm{

    struct json {
        string obj;
    }

      mapping(uint=>json[]) public values;

    function set(uint id,string memory _obj) public{
         values[id].push(json({
               obj: _obj
         })
    );
    }


    function get(uint id) public view returns(json[] memory){

        return values[id];

    }

}
